import React from "react";


function BottomMenu(props) {

    return (
        <div className="bottomMenu" onClick={props.SetCloseSideMenu}>
            {props.bottomMenuItems.map((data) => {
                return <MenuItem
                    key={data}
                    name={data}
                    subMod={props.SetSubModule}
                />
            })}
        </div>
    )
}

function MenuItem(props) {
    return <button onClick={props.subMod} name={props.name}
                   className={ props.subMod === props.name ? "button btn-botMenu btn-botMenu-active" : props.name }
    >{props.name}</button>
}

export default BottomMenu;
